INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AREB', 'STOCK', 'American Rebel Holdings, Inc.', 'NCM', 'Consumer Cyclical', 'Footwear & Accessories', 'American Rebel Holdings, Inc. operates primarily as a designer, manufacturer and marketer of branded safes and personal security and self-defense products. Additionally, the Company designs and produces branded apparel and accessories. In addition to branded safes, it offers an assortment of personal security products as well as apparel and accessories for men and women under the Companys American Rebel brand. The Companys safes and personal security products are constructed primarily of United States-made steel. Its products are designed to safely store firearms, as well as store its customers priceless keepsakes, family heirlooms and treasured memories and other valuables. It produces large floor safes in a variety of sizes as well as small portable keyed safes. It sells its products online to individuals desiring home, personal and office protection, as well as to recreational shooters and hunters. Its gun safes include Constitution 25 Gun Safe and Constitution 40 Gun Safe.', 'Brentwood, TN, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEA', 'STOCK', 'Easterly Government Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Office', 'Easterly Government Properties, Inc. is an internally managed real estate investment trust (REIT). It is focused primarily on the acquisition, development and management of Class A commercial properties that are leased to United States government agencies that serve essential functions. It leases its properties to such agencies either directly or through the United States General Services Administration (GSA). The operations of the Company are carried out primarily through Easterly Government Properties, LP (the Operating Partnership) and the wholly owned subsidiaries of the Operating Partnership. The Company owns, directly or through the joint venture, 102 properties totaling 10.2 million square feet. Its properties include VA - Loma Linda, JSC - Suffolk, Various GSA - Chicago, IRS - Fresno, FBI - Salt Lake, VA - San Jose, EPA - Lenexa, FBI - Tampa, FBI - San Antonio, FDA - Alameda, PTO - Arlington, FBI - Omaha, TREAS - Parkersburg, FDA - Lenexa, VA - South Bend, and DHS - Burlington.', 'Washington, DC, United States', 50);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('API', 'STOCK', 'Agora, Inc.', 'NMS', 'Technology', 'Software - Application', 'Agora Inc. is a holding company of two independent divisions, under the Agora brand and Shengwang brand, whose businesses are conducted through separate entities. Agora provides Real-Time Engagement Platform-as-a-Service (PaaS) that operates in the United States, as well as other international markets outside the United States and China. Shengwang provides Real-Time Engagement PaaS in the China market. The Company provides developers with customizable and compatible application programming interfaces (APIs), to embed real-time voice, video, interactive live-streaming, chat, whiteboard, and artificial intelligence capabilities into their applications without the need to develop the technology or build the underlying infrastructure themselves. The real-time data transmission is handled by the Companys Software-Defined Real-Time Network (SD-RTN), which is a virtual network overlay on top of the public Internet.', 'Santa Clara, CA, United States', 608);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FLGT', 'STOCK', 'Fulgent Genetics, Inc.', 'NGM', 'Healthcare', 'Diagnostics & Research', 'Fulgent Genetics, Inc. is a technology-based company with a laboratory services business and a therapeutic development business. Its laboratory services business includes technical laboratory and testing services and professional interpretation of laboratory results by licensed physicians. Its therapeutic development business is focused on developing drug candidates for treating a range of cancers using a novel nanoencapsulation and targeted therapy platform designed to improve the therapeutic window and pharmacokinetic profile of new and existing cancer drugs. Its testing services include comprehensive anatomic pathology testing services, including gastrointestinal pathology, dermatopathology, urologic pathology, breast pathology, neuropathology, and hematopathology, and precision diagnostics testing services, including next-generation sequencing (NGS), tests for biopharma research and clinical tests for rare disease, hereditary cancer, reproductive health, and many other diseases.', 'El Monte, CA, United States', 1313);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGP', 'STOCK', 'EastGroup Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Industrial', 'EastGroup Properties, Inc. is an internally managed equity real estate investment trust (REIT). The Company is focused on the development, acquisition, and operation of industrial properties in Sunbelt markets throughout the United States, primarily in the states of Florida, Texas, Arizona, California, and North Carolina. The Company owns approximately 563 industrial properties in 12 states. The Companys portfolio includes development projects and value-added properties under lease-up and construction, including approximately 63.1 million square feet consisting of 497 business distribution properties containing 57.8 million square feet, 17 bulk distribution properties containing 4.4 million square feet, and 22 business service properties containing 900,000 square feet. The Companys properties are Riverpoint Industrial Park, Akimel Gateway, Waterford Distribution Center, Chestnut Business Center, and others.', 'Ridgeland, MS, United States', 101);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OLB', 'STOCK', 'The OLB Group, Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'The OLB Group, Inc. is a fintech company that focuses on a suite of products in the merchant services marketplace and seeks to provide integrated business solutions to merchants throughout the United States. It seeks to provide merchants with a range of products and services through its various online platforms, including financial and transaction processing services. Its business functions through three subsidiaries: eVance, Inc. (eVance), OmniSoft.io, Inc. (OmniSoft), and CrowdPay.Us, Inc. (CrowdPay). OmniSoft operates a cloud-based business management platform that provides turnkey solutions for merchants to enable them to build and manage their retail businesses. eVance provides competitive payment processing solutions to merchants, which enable merchants to process credit and debit card-based Internet payments for sales of their products. CrowdPay operates a white-label capital-raising platform that targets small and midsized businesses seeking to raise capital.', 'New York, NY, United States', 15);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARIS', 'STOCK', 'Aris Water Solutions, Inc.', 'NYQ', 'Utilities', 'Utilities - Regulated Water', 'Aris Water Solutions, Inc. is an environmental infrastructure and solutions company. The Company helps customers reduce their water and carbon footprints. It delivers full-cycle water handling and recycling solutions for energy operations. Its integrated pipelines and related infrastructure create produced water management, recycling, and supply solutions for operators in the core areas of the Permian Basin. The Company manages its business through a single operating segment comprising two primary revenue streams: Produced Water Handling and Water Solutions. The Produced Water Handling business gathers, transports and, unless recycled, handles produced water generated from oil and natural gas production. The Water Solutions business develops and operates recycling facilities to treat, store and recycle produced water. The Company also supplements its recycled produced water with non-potable groundwater to meet the demands of its customers'' operations.', 'Houston, TX, United States', 276);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FALN', 'STOCK', 'iShares Fallen Angels USD Bond ETF', 'NGM', NULL, NULL, 'The fund will invest at least 80% of its assets in the component securities of the underlying index, and the fund will invest at least 90% of its assets in fixed income securities of the types included in the underlying index. The index is designed to reflect the performance of U.S. dollar denominated, high yield corporate bonds that were previously rated investment grade.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSBR', 'STOCK', 'Banco Santander (Brasil) S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'O Banco Santander Brasil SA é um banco brasileiro. O Banco atua através de dois segmentos: Varejo e Atacado. O segmento Varejo presta serviços financeiros a particulares, bem como a pequenas e médias empresas. O segmento de Atacado concentra-se em grandes corporações e mercados de capitais. Juntamente com as suas subsidiárias, o Banco oferece uma gama de serviços financeiros, incluindo serviços bancários de consumo, comercial e de investimento, empréstimos e financiamentos, empréstimos hipotecários, leasing, operações de cartão de crédito e câmbio. O Banco também está envolvido nas operações de gestão de ativos, capitalização, corretagem de valores mobiliários, corretagem de seguros e planos de pensões. A Companhia possui diversas subsidiárias, como Santander Corretora de Cambio e Valores Mobiliarios SA, Banco Bandepe SA e Sancap Investimentos e Participações SA, entre outras.', 'São Paulo, SP, Brazil', 53918);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('LPAA', 'STOCK', 'Launch One Acquisition Corp.', 'NGM', 'Financial Services', 'Shell Companies', 'Launch One Acquisition Corp. is a blank check company. The Company is formed for the purpose of effecting a merger, amalgamation, share exchange, asset acquisition, share purchase, reorganization, or similar business combination with one or more businesses. It has not selected any business combination target and the Company has not, nor has anyone on its behalf, engaged in any substantive discussions, directly or indirectly, with any business combination target. It has no operations nor generated any revenues.', 'Oakland, CA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHMI', 'STOCK', 'Cherry Hill Mortgage Investment Corporation', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Cherry Hill Mortgage Investment Corporation is a real estate finance company. The Company is focused on acquiring, investing in, and managing residential mortgage assets in the United States. Its segments include investments in residential mortgage-backed securities (RMBS), investments in Servicing Related Assets, and All Other. The Companys principal objective is to generate yields and risk-adjusted total returns for its stockholders over the long term, primarily through dividend distributions and secondarily through capital appreciation. The Company focuses on attaining this objective by selectively constructing and actively managing a portfolio of servicing-related assets and RMBS. The Company may also invest in other cash -lowing residential mortgage assets. It is externally managed by Cherry Hill Mortgage Management, LLC.', 'Tinton Falls, NJ, United States', 12);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EARN', 'STOCK', 'Ellington Credit Company', 'NYQ', 'Financial Services', 'Asset Management', 'Ellington Credit Company is a non-diversified closed-end fund. The Company is focused on acquiring, investing in, and managing secondary collateralized loan obligations (CLO) mezzanine debt and equity tranches. It is specialized in acquiring, investing in, and managing residential mortgage- and real estate-related assets. The Company''s primary objective is to generate attractive risk-adjusted total returns for its shareholders by making investments in multiple parts of the CLO capital structure, including mezzanine debt and equity tranches. Additionally, it may also invest in CLO loan accumulation facilities, which are entities that acquire corporate loans and other similar corporate credit-related assets in anticipation of ultimately collateralizing a CLO transaction, as well as other related assets. It is externally managed and advised by Ellington Credit Company Management LLC.', 'Old Greenwich, CT, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMDG', 'STOCK', 'Themes ETF Trust - Leverage Shares 2X Long AMD Daily ETF', 'NGM', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OSRH', 'STOCK', 'OSR Holdings, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'OSR Holdings, Inc. is a global healthcare company, dedicated to advancing healthcare outcomes and improving the quality of life for people and their families. The Company is focused on building and developing a portfolio of transformative therapies and healthcare solutions. The Company''s operating businesses (through its three wholly owned subsidiaries) include developing oral immunotherapies for the treatment of cancer, developing design-augmented biologics for age-related and other degenerative diseases and neurovascular intervention medical device and systems distribution in Korea. The Companys subsidiary, Vaximms flagship asset, VXM01, is a late clinical-stage (NCT037500701) immuno-oncology candidate for glioblastoma. Vaximm has three clinical and pre-clinical drug candidates targeting diseases ranging from glioblastoma to gastrointestinal stromal tumor to ocular diseases. The Company has operations in Europe and South Korea.', 'Bellevue, WA, United States', 19);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKH', 'STOCK', 'Black Hills Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'Black Hills Corporation is a customer-focused, growth-oriented utility company. It serves 1.35 million natural gas and electric utility customers in eight states: Arkansas, Colorado, Iowa, Kansas, Montana, Nebraska, South Dakota and Wyoming. Its segments include Electric Utilities and Gas Utilities. Its Electric Utilities segment generates, transmits and distributes electricity to approximately 225,000 electric utility customers in Colorado, Montana, South Dakota, and Wyoming. Its Electric Utilities own 1,394 megawatts of generation and 9,196 miles of electric transmission and distribution lines. Its Gas Utilities segment serves over 1,128,000 natural gas utility customers in Arkansas, Colorado, Iowa, Kansas, Nebraska, and Wyoming. Its Gas Utilities own and operate 4,648 miles of intrastate gas transmission pipelines and 44,524 miles of gas distribution mains and service lines, seven natural gas storage sites, over 50,000 horsepower of compression, and 516 miles of gathering lines.', 'Rapid City, SD, United States', 2841);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGBN', 'STOCK', 'Eagle Bancorp, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Eagle Bancorp, Inc. is a bank holding company for EagleBank (the Bank). The Bank is a chartered commercial bank. The Company, through the Bank, conducts a full-service community banking business in Northern Virginia, Suburban Maryland and Washington, D.C. The primary financial services offered by the Bank include real estate, commercial and consumer lending, as well as traditional deposit and repurchase agreement products. The Bank offers a range of commercial banking services to its business and professional clients, as well as consumer banking services to individuals living and/or working primarily in the Banks market area. The Banks loan portfolio consists of traditional business and real estate secured loans. It operates 12 branch offices: six in Suburban Maryland, three located in the District of Columbia, and three in Northern Virginia. It also has four lending centers and utilizes various digital capabilities, including remote deposit services and mobile banking services.', 'Bethesda, MD, United States', 451);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CXW', 'STOCK', 'CoreCivic, Inc.', 'NYQ', 'Industrials', 'Security & Protection Services', 'CoreCivic, Inc. is a diversified, government-solutions company. The Company provides a range of solutions to government partners that serve the public good through corrections and detention management, a network of residential and non-residential alternatives to incarceration to help address Americas recidivism crisis, and government real estate solutions. Its CoreCivic Safety segment consists of correctional and detention facilities that are owned or controlled via a long-term lease and managed by the Company, as well as those correctional and detention facilities owned by third parties but managed by the Company. The segment also provides transportation services. CoreCivic Community segment consists of residential reentry centers that are owned or controlled via a long-term lease and managed by the Company. The segment also includes electronic monitoring and case management services. CoreCivic Properties segment consists of correctional real estate properties owned by the Company.', 'Brentwood, TN, United States', 11649);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMN', 'STOCK', 'AMN Healthcare Services, Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'AMN Healthcare Services, Inc. is a provider of total talent solutions for healthcare organizations across the United States. The Company provides access to a comprehensive network of quality healthcare professionals through its recruitment strategies and breadth of career opportunities. Its segments include nurse and allied solutions, physician and leadership solutions, and technology and workforce solutions. The nurse and allied solutions segment includes its travel nurse staffing, labor disruption staffing, local staffing, international nurse permanent placement, and allied staffing businesses. The physician and leadership solutions segment includes its locum tenens staffing, healthcare interim leadership staffing, executive search, and physician permanent placement businesses. The technology and workforce solutions segment includes the Companys language services, vendor management systems (VMS), workforce optimization, and outsourced solutions businesses.', 'Dallas, TX, United States', 2968);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVDL', 'STOCK', 'Avadel Pharmaceuticals plc', 'NGM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Avadel Pharmaceuticals PLC is a biopharmaceutical company. The Company''s product, LUMRYZ, is an extended-release formulation of sodium oxybate, indicated to be taken once at bedtime for the treatment of cataplexy or excessive daytime sleepiness (EDS) in adults with narcolepsy. Its approach includes applying solutions to the development of medications that address the challenges patients face with treatment options. Its drug delivery technologies include MICROPUMP, LIQUITIME, and MEDUSA. Its MICROPUMP technology allows for the development of modified-release solid, oral dosage formulations of drugs. Its LIQUITIME technology allows for the development of modified-release oral products in a liquid suspension formulation, which may make such formulations particularly suited for children and/or patients having issues swallowing tablets or capsules. Its MEDUSA technology allows for the development of modified-release injectable dosage formulations of drugs.', 'Dublin, , Ireland', 188);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLB', 'STOCK', 'Core Laboratories Inc.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Christina Lake Cannabis Corp. is a Canada-based licensed producer of cannabis. The Company is engaged in the processing of its stock of outdoor flowers. They also process dried Cannabis biomass into various extracts, including distilled and winterized oils, kief, and additional extracted products for sale to other licensed producers. The Companys facilities consist of a 32-acre property, which includes over 950,000 square feet of outdoor grow space, offices, propagation and drying rooms, research facilities, and a facility dedicated to processing and extraction. The 342-acre property includes approximately 100-acres of licensed outdoor grow space, greenhouses, and a dryroom. The Company also owns a 99-acre plot of land adjoining its principal site. It focuses its production on creating extracts and distillates for its business-to-business (B2B) client base with proprietary strains specifically developed for outdoor cultivation to enhance extraction quality.', 'Houston, TX, United States', 3300);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRW', 'STOCK', 'Saba Capital Income & Opportunities Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Saba Capital Income & Opportunities Fund is a closed-ended fixed income mutual fund launched by Voya Investment Management LLC. The fund is managed by Saba Capital Management, L.P. It invests in the fixed income markets of the United States. The fund seeks to invest in securities of companies operating across diversified sectors. It primarily invests in floating rate secured senior loans, with an emphasis on top-tier, non-investment grade senior loans. The fund seeks to invest in loans with maturities of one to ten years. It benchmarks the performance of its portfolio against the S&P/LSTA Leveraged Loan Index. The fund was formerly known as Voya Prime Rate Trust. Saba Capital Income & Opportunities Fund was formed on December 2, 1987 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('E', 'STOCK', 'Eni S.p.A.', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'A Eni SpA (Eni) é uma empresa com sede na Itália que se dedica à exploração, desenvolvimento e produção de hidrocarbonetos, ao fornecimento e comercialização de gás, gás natural liquefeito (GNL) e energia, no refino e comercialização de produtos petrolíferos, na produção e comercialização de petroquímicos básicos, plásticos e elastômeros e no comércio de mercadorias. Seu segmento de Exploração e Produção se dedica à exploração de petróleo e gás natural e ao desenvolvimento e produção de campo, além de operações de GNL em mais de 40 países, incluindo Itália, Líbia, Egito, Noruega, Reino Unido, Angola, Congo, Nigéria e Estados Unidos, Cazaquistão, Argélia, Austrália, Venezuela, Iraque, Gana e Moçambique. Seu segmento de Gás e Energia atua no fornecimento, comercialização e comercialização de gás, GNL e eletricidade, atividades de transporte internacional de gás e comércio de mercadorias e derivados.', 'Rome, RM, Italy', 32356);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCOI', 'STOCK', 'Cogent Communications Holdings, Inc.', 'NMS', 'Communication Services', 'Telecom Services', 'Cogent Communications Holdings, Inc. is a facilities-based provider of Internet access, private network services, optical wavelength, and optical transport services and data center colocation space and power. The Company, through its own facilities, offers on-net Internet access services to customers located in buildings that are physically connected to its network. Its network is specifically designed and optimized to transmit packet routed data. Its on-net service consists of high-speed Internet access and private network services offered at speeds ranging from 100 megabits per second (Mbps) to 400 gigabits per second (Gbps). The Company delivers its services on its network in 56 countries across North America, Europe, South America, Oceania and Africa. Its corporate customers are located in multi-tenant office buildings (MTOBs), which include law firms, advertising and marketing firms, as well as healthcare providers, and other professional services businesses, among others.', 'Washington, DC, United States', 1916);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BZUN', 'STOCK', 'Baozun Inc.', 'NMS', 'Consumer Cyclical', 'Internet Retail', 'Baozun Inc is a holding company mainly engaged in the provision of brand e-commerce solutions. The Company focus on providing integrated brand-e-commerce solutions to their brand partners, including information technology (IT) solutions, online store operation, digital marketing, customer services, as well as warehousing and fulfillment. The Company operates under three business models: distribution model, service fee model and consignment mode, according to different needs of their brand partners. The Company provides omni-channel solutions across official brand stores, online marketplaces, such as Tmall, JD.com and Pinduoduo, and social media channels, such as WeChat Mini Programs and RED (Xiaohongshu), as well as emerging live streaming and short video platforms, such as Douyin and Kuaishou.', 'Shanghai, , China', 7650);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CARG', 'STOCK', 'CarGurus, Inc.', 'NMS', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'CarGurus, Inc. (CarGurus) offers a multinational, online automotive platform for buying and selling vehicles that offer both digital retail solutions and the CarOffer digital wholesale platform. The CarGurus platform enables consumers to purchase and/or sell a vehicle either online or in-person, and it gives dealerships the power to accurately price, instantly acquire, effectively market, and quickly sell vehicles, all with a nationwide reach. It operates through two segments: U.S. Marketplace and Digital Wholesale. The U.S. Marketplace segment provides marketplace services for customers within the United States. Digital Wholesale segment provides Dealer-to-Dealer and Instant Max Cash Offer (IMCO) services and products which are sold on the CarOffer platform. The Company operates online marketplaces under the CarGurus brand in Canada and the United Kingdom. It also operates independent brands, the Autolist and PistonHeads online marketplaces in the United States and the United Kingdom.', 'Boston, MA, United States', 1282);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABUS', 'STOCK', 'Arbutus Biopharma Corporation', 'NMS', 'Healthcare', 'Biotechnology', 'Arbutus Biopharma Corporation is a clinical-stage biopharmaceutical company focused on infectious disease. The Company is developing imdusiran (AB-729), its proprietary, conjugated GalNAc, subcutaneously delivered RNAi therapeutic, and AB-101, its proprietary oral PD-L1 inhibitor, for the treatment of chronic hepatitis B (cHBV). Its HBV product pipeline includes Imdusiran and AB-101. Its pipeline includes two product candidates that target various steps in the HBV viral lifecycle and consists of various programs: RNAi therapeutic (imdusiran, AB-729) and Oral PD-L1 Inhibitor (AB-101). RNAi therapeutics utilize a natural pathway within cells to silence genes by eliminating the disease-causing proteins that they code for. PD-L1 inhibitors complement its pipeline of agents and could potentially be a part of a combination therapy for the treatment of HBV by reawakening the immune system.', 'Warminster, PA, United States', 44);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOMO', 'STOCK', 'Domo, Inc.', 'NGM', 'Technology', 'Software - Application', 'Domo, Inc. provides a cloud-based platform is an artificial intelligence (AI) and data products platform that enables processes that are dependent on business intelligence data from marketing to operations, human resources to finance, information technology to product development, and supply chain to sales. Its platform enables every type of employee to connect to, analyze, and leverage data from their smartphone. Its platform provides real-time access to quantitative and qualitative data. Through the Domo platform, data from across the business is collected, stored, prepared, organized, analyzed, visualized, automated and distributed. AI algorithms and machine learning can be applied to the data. Its platform provides real-time access to data through a flexible set of connection options, including an application programming interface and standards-based connectors that are available in the Domo Appstore, and a library of flexible universal connectors.', 'American Fork, UT, United States', 888);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYCC', 'STOCK', 'Cyclacel Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cyclacel Pharmaceuticals, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing cancer medicines based on cell cycle, epigenetics and mitosis biology. Its epigenetic/anti-mitotic program is evaluating plogo, a Polo-like kinase 1 (PLK1) inhibitor, in solid tumors and hematological malignancies. PLK1 is a serine/threonine kinase with a central role in cell division, or the mitotic phase of the cell cycle, and is a regulator of the DNA damage checkpoint. The Companys plogo is a novel, small-molecule, selective and potent PLK1 inhibitor, which has demonstrated potent and selective target inhibition (PLK1 IC50 approximately 3 nM) and efficacy in human tumor xenografts at non-toxic doses. Its translational biology program supports the development of plogo in solid tumor and hematological malignancy indications. PLK1 over-expressing tumors include colorectal, esophageal, gastric, leukemia, lung, lymphoma, ovarian and squamous cell cancers.', 'Kuala Lumpur, , Malaysia', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVT', 'STOCK', 'Avnet, Inc.', 'NMS', 'Technology', 'Electronics & Computer Distribution', 'Avnet, Inc. is a global electronic component technology distributor and solutions provider. It markets, sells, and distributes electronic components from electronic component manufacturers, including semiconductors, interconnect, passive and electromechanical components, and other integrated and embedded components. Its primary operating groups include Electronic Components (EC) and Farnell. EC serves a variety of markets ranging from industrial to automotive to defense and aerospace. EC offers an array of customer support options throughout the entire product lifecycle, including turnkey and customized design, supply chain, programming, logistics and post-sales services. The Farnell operating group primarily supports lower-volume customers and distributes a portfolio of kits, tools, electronic components, industrial automation components, and test and measurement products to both engineers and entrepreneurs, through an e-commerce channel. It also distributes new product introductions.', 'Phoenix, AZ, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRMA', 'STOCK', 'Dermata Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Dermata Therapeutics, Inc. is a late-stage medical dermatology company. The Company is focused on identifying, developing, and commercializing pharmaceutical product candidates for the treatment of medical and aesthetic skin conditions and diseases. Its two product candidates, XYNGARI and DMT410, both incorporate its proprietary, multifaceted, Spongilla technology to topically treat a variety of dermatological conditions. Its lead product candidate, XYNGARI, is intended to utilize its Spongilla technology for once weekly treatment of a variety of skin diseases, with its initial focus being the treatment of acne vulgaris, which has a United States market size of approximately 30 million patients seeking treatment. The Companys second product candidate, DMT410, uses its XYNGARI product candidate as a new method for needle-free intradermal delivery of botulinum toxin for the treatment of multiple aesthetic applications and medical skin diseases.', 'San Diego, CA, United States', 8);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKAN', 'STOCK', 'Akanda Corp.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Akanda Corp. is a United Kingdom-based company, which is focused on the growth of its Canadian farming property in British Columbia. The Company plans to develop tetrahydrocannabinol (THC) and cannabidiol (CBD) facilities.', 'Toronto, ON, Canada', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TVGN', 'STOCK', 'Tevogen Bio Holdings Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Tevogen Bio Holdings Inc. is a clinical-stage specialty immunotherapy company. The Company is harnessing CD8+ cytotoxic T lymphocytes (CD8+ CTLs), to develop off-the-shelf, genetically unmodified precision T cell therapies for the treatment of infectious diseases, cancers, and neurological disorders, aiming to address the unmet needs of patient populations. Its first product candidate, TVGN 489, has developed to fill a critical gap in COVID-19 therapeutics for the immunocompromised and the high-risk elderly, with potential applications in both treatment and prevention of chronic lingering symptoms of the disease. Its TVGN 601 is being developed for multiple sclerosis (MS), and its TVGN 930 is being developed for EBV-associated lymphomas.', 'Warren, NJ, United States', 18);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBDC', 'STOCK', 'Barings BDC, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Barings BDC, Inc. is a closed-end, non-diversified investment company. The Companys investment objective is to generate current income by investing directly in privately held middle-market companies to help these companies fund acquisitions, growth or refinancing. The Company seeks to invest primarily in senior secured loans in middle-market companies that operate across a range of industries. It invests primarily in loans that have terms of between five and seven years, and bear interest at rates ranging from the London Interbank Offered Rate (LIBOR) (or an applicable successor rate) plus 450 basis points to LIBOR plus 650 basis points per annum. Its investment capabilities include first lien debt, unitranche, second lien debt and equity co-investments. It invests in various industries, including banking, finance, insurance and real estate, business, healthcare & pharmaceuticals, and others. Its investment activities are managed by its investment adviser, Barings LLC.', 'Charlotte, NC, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('PAYC', 'STOCK', 'Paycom Software, Inc.', 'NYQ', 'Technology', 'Software - Application', 'A Paycom Software, Inc. É fornecedora de uma solução abrangente de gerenciamento de capital humano (HCM) baseada na nuvem, fornecida como software como serviço (SaaS). A empresa fornece funcionalidade e análise de dados. Sua solução não requer praticamente nenhuma personalização e é baseada em um sistema central de registro mantido em um único banco de dados para todas as funções de HCM, incluindo aquisição de talentos, gerenciamento de tempo e mão de obra, folha de pagamento, gerenciamento de talentos e aplicativos de gerenciamento de recursos humanos (RH). Suas aplicações simplificam os processos do cliente e fornecem aos clientes e seus funcionários a capacidade de acessar e gerenciar diretamente processos administrativos, incluindo aplicativos que identificam candidatos, funcionários a bordo, gerenciam tempo e mão de obra, administram deduções e benefícios de folha de pagamento, gerenciam o desempenho, encerram funcionários e administram benefícios de saúde pós-término, como COBRA.', 'Oklahoma City, OK, United States', 7306);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CREV', 'STOCK', 'Carbon Revolution Public Limited Company', 'NGM', 'Consumer Cyclical', 'Auto Parts', 'Carbon Revolution plc is a technology company and original equipment manufacturer (OEM) supplier. The Company has commercialized and industrialized the supply of lightweight carbon fiber wheels to the automotive industry. The Company has progressed from single prototypes to designing and manufacturing lightweight wheels for cars and SUVs in the high performance, premium and luxury segments, for the automotive brands. It is focused on creating an advanced technology business that supplies its lightweight wheel technology to automotive manufacturers around the world. Its lightweight technology provides unparalleled improvements in performance, efficiency and handling, which translates to better drivability, fuel efficiency, range extension and reduction in lap times. Its applications include automotive, OEM, electric vehicles, aerospace, motorsport, and heavy vehicles. The Company is the parent of Carbon Revolution Pty Ltd.', 'Dublin, , Ireland', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIPC', 'STOCK', 'Brookfield Infrastructure Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'Brookfield Infrastructure Corporation is a global infrastructure company. It owns and operates assets in the utilities, transport, midstream and data sectors across the Americas, Asia Pacific and Europe. Its operations include a United Kingdom-regulated distribution operation, a Brazilian regulated gas transmission operation and a global intermodal logistics operation. Its regulated gas transmission operation in Brazil operates over 2,000 kilometers of natural gas transportation pipelines in the states of Rio de Janeiro, Sao Paulo and Minas Gerais. Its regulated distribution operation is the independent last-mile, multi-utility connection provider, with approximately 4.5 million connections. Its global intermodal logistics operation is the lessor of intermodal containers with a fleet of four million containers representing seven million twenty-foot equivalent units. Operations include the acquisition, leasing, re-leasing, and subsequent sale of multiple types of intermodal containers.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DENN', 'STOCK', 'Denny''s Corporation', 'NCM', 'Consumer Cyclical', 'Restaurants', 'Denny''s Corporation is a franchised full-service restaurant chain. The Company owns and operates the Dennys brand (Dennys) and the Kekes Breakfast Cafe brand (Kekes). It operates in two segments: Dennys and Kekes. It has approximately 1,568 restaurants, 1,493 of which were franchised/licensed restaurants and 75 of which were Company-operated. The Dennys brand consists of over 1,499 franchised, licensed and company restaurants around the world, including 1,334 restaurants in the United States and 165 international restaurant locations. Dennys offers a wide selection of lunch and dinner items, including entrees, burgers, sandwiches and salads, along with an assortment of appetizers and desserts. It has four dayparts, breakfast, lunch, dinner and late night. Kekes is a daytime eatery dedicated to providing a breakfast experience. Kekes brand consists of over 69 franchised and company restaurants in the United States. Kekes also serves burgers, paninis, salads, and sandwiches.', 'Spartanburg, SC, United States', 3800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADTX', 'STOCK', 'Aditxt, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Aditxt, Inc. is a social innovation platform dedicated to accelerating promising health innovations. It develops and commercializes technologies with a focus on monitoring and modulating the immune system. Its portfolio includes Adimune, Inc., developing a new class of therapeutics designed to retrain the immune system to address organ rejection, autoimmunity, and allergies; Adivir, Inc., focused on identifying, developing, and commercializing new ways to treat infectious diseases, and Pearsanta, Inc., offering personalized lab testing, backed by CLIA-certified and CAP-accredited monitoring center. Adimune, Inc''s immune modulation product candidate, ADI-100, is based on the Apoptotic DNA Immunotherapy platform technology, utilizes a novel approach that mimics the way bodies naturally induce tolerance to own tissues. It also offers electroencephalography (EEG) brain monitoring technologies and devices, including NeuroCap and NeuroEEG for telehealth and tele-neurology applications.', 'Mountain View, CA, United States', 26);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNTH', 'STOCK', 'Dianthus Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Dianthus Therapeutics, Inc. is a clinical-stage biotechnology company engaged in designing and delivering monoclonal antibodies with improved selectivity and potency. The Company is focused on developing complement therapeutics for patients living with severe autoimmune and inflammatory diseases. Its advanced product candidate, DNTH103, is a clinical-stage, highly potent, selective and fully human monoclonal immunoglobulin G4 with picomolar binding affinity that is designed to selectively bind only to the active form of C1s. DNTH103 is engineered with YTE half-life extension technology, a specific three amino acid change in the Fc domain, and has a pharmacokinetic (PK) profile designed to support less frequent, lower dose, self-administration as a convenient S.C. injection. It is conducting three mid- to late-stage clinical trials with DNTH103 in generalized Myasthenia Gravis (gMG), Chronic Inflammatory Demyelinating Polyneuropathy (CIDP), and Multifocal Motor Neuropathy (MMN).', 'New York, NY, United States', 78);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNMD', 'STOCK', 'CONMED Corporation', 'NYQ', 'Healthcare', 'Medical Devices', 'CONMED Corporation is a medical technology company, which provides devices and equipment for surgical procedures. Its products are used by surgeons and other healthcare professionals in a variety of specialties, including orthopedics, general surgery, gynecology, thoracic surgery and gastroenterology. Its product lines consist of orthopedic surgery and general surgery. Orthopedic surgery consists of sports medicine instrumentation and lower extremities instrumentation and implants, small bone, large bone and specialty-powered surgical instruments as well as imaging systems for use in minimally invasive surgical procedures and service fees related to the promotion and marketing of sports medicine allograft tissue. General surgery consists of a complete line of endo-mechanical instrumentation for minimally invasive laparoscopic and gastrointestinal procedures, smoke evacuation devices, a line of cardiac monitoring products as well as electrosurgical generators and related instruments.', 'Largo, FL, United States', 3900);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVY', 'STOCK', 'Avery Dennison Corporation', 'NYQ', 'Consumer Cyclical', 'Packaging & Containers', 'A Avery Dennison Corporation é uma empresa global de soluções de ciência de materiais e identificação digital. A empresa fornece uma gama de soluções de branding e informação que otimizam a eficiência da mão-de-obra e da cadeia de fornecimento, reduzem o desperdício, promovem a sustentabilidade, a circularidade e a transparência, e conetam marcas e consumidores. Seu segmento de Grupo de Materiais fabrica e vende materiais de etiquetas sensíveis à pressão, filmes para produtos gráficos e reflexivos, fitas de desempenho e outros produtos adesivos para aplicações industriais, médicas e outras, bem como soluções de fixadores. Seu segmento Solutions Group projeta, fabrica e vende uma variedade de soluções de marca e informação, incluindo bilhetes de marca e preço, etiquetas e rótulos (incluindo inlays de identificação por radiofrequência (RFID)), e serviços relacionados, suprimentos e equipamentos. Ela atende uma variedade de indústrias em todo o mundo, incluindo cuidados domésticos e pesso', 'Mentor, OH, United States', 35000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CING', 'STOCK', 'Cingulate Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cingulate Inc. is a biopharmaceutical company. The Company is focused on the development, manufacturing, and commercialization of pharmaceutical products that utilize its precision timed release (PTR) drug delivery platform technology to create dosing schedules and drug release profiles. It focuses on the treatment of attention deficit/hyperactivity disorder (ADHD). The Company is in the development of two lead product candidates, such as CTx-1301 (dexmethylphenidate) and CTx-1302 (dextroamphetamine). The Companys CTx-1301 and CTx-1302 are being developed for the treatment of ADHD in the three core patient segments: children (ages 6-12), adolescents (ages 13-17), and adults (ages18+). In addition, the Company has a third product to treat anxiety, CTx-2103, in a formulation stage. Its CTx-1301, CTx-1302 and CTx-2103 drug candidates contain three releases of active pharmaceutical ingredient combined into one small tablet dosage form.', 'Kansas City, KS, United States', 13);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDJ', 'STOCK', 'BlackRock Enhanced Equity Dividend Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Enhanced Equity Dividend Trust is a closed-ended equity mutual fund launched by BlackRock, Inc. The fund is managed by BlackRock Advisors, LLC. It invests in the public equity markets of the United States. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in dividend paying stocks of companies across all market capitalizations. The fund also invests through derivatives, with an emphasis on option writing. It benchmarks the performance of its portfolio against the Russell 1000 Value Index. The fund was formerly known as BlackRock Enhanced Dividend Achievers TM Trust. BlackRock Enhanced Equity Dividend Trust was formed on August 31, 2005 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
